#include <bits/stdc++.h>

using namespace std;

bool check(char s, queue<char> m){
	while(!m.empty()){
		if(m.front() == s) return true;
		m.pop();	
	}
	return false;
}

void solve() {
	string s = "";
	queue<char> marker;
	int i = 0;
	while(marker.size() < 14){ //change 14 to 4 for part 1 answer
		while(check(s[i], marker)){
			marker.pop();
		}
		marker.push(s[i]);
		i++;
	}
	cout<<i;
}

int main() {
	ios::sync_with_stdio(0);
	cin.tie(0);

	solve();

	return 0;
}